#include "http_parser.h"
#include <stdint.h>
#include <stdlib.h>

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  if (size < 1) {
    return 0;
  }

  enum http_errno err = (enum http_errno)*data;
  if (err < 0 || err >= _HTTP_ERRNO_MAX) {
    return 0;
  }
  const char *description = http_errno_description(err);

  return 0;
}

#include "http_parser.h"
#include <stdint.h>
#include <stdlib.h>
#include <string.h>

#ifdef __cplusplus
extern "C" {
#endif

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {

  if (size == 0) {
    return 0;
  }

  http_errno err = (http_errno) (*data % _HTTP_ERRNO_MAX);

  const char * description = http_errno_description(err);

  return 0;
}

#ifdef __cplusplus
}
#endif
